import React from 'react';
import Album from './Album';
import data from './data.json';

const Albums = () => {
  return (
    <div>
      <Navbar />
      <div className="albums">
        {data.map((album) => (
          <Album key={album.id} album={album} />
        ))}
      </div>
    </div>
  );
};

export default Albums;
